import React,{ Component } from "react";
import { Table } from "reactstrap";
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

function* values(obj) {
    for (let prop of Object.keys(obj)) // own properties, you might use
                                       // for (let prop in obj)
        yield obj[prop];
}
class NurseList extends Component{
    constructor(props){
        super(props)
        this.state={
            Nurses:[],
            isLoaded:false
        }
    }
    async componentDidMount(){
        const url="http://localhost:3001/Nurse"
        const response = await fetch(url)
        const data = await response.json()
        if(data.length>0){
            this.setState({Nurses:data})
            this.setState({isLoaded:true})
        }
        else
            toast('kjsdkjsnk')
    }
    showList(){
        let data = this.state.Nurses
        let rows=[]
        console.log(data)
        if(this.state.isLoaded){
            for (let index = 0; index < data.length; index++) {
                rows.push(
                    <tr>
                        <td>{data[index].nurse_id}</td>
                        <td>{data[index].name}</td>
                        <td>{data[index].gender}</td>
                        <td>{data[index].city}</td>
                        <td>{data[index].mob_no}</td>
                        <td>{data[index].email}</td>
                        <td>{data[index].join_date}</td>
                        <td>{data[index].name}</td>
                    </tr>
                ) 
            }
            return rows
        }
    }
    render(){
        // const data = Array.from(values(this.state.Nurses));
        let rows = this.state.Nurses;
        return(
            <div>
                <ToastContainer position="top-right"
                    autoClose={5000}
                    hideProgressBar={false}
                    newestOnTop={false}
                    closeOnClick
                    rtl={false}
                    pauseOnFocusLoss
                    draggable
                    pauseOnHover/>
                <Table className="highlight">

                    <thead>
                        <tr>
                            <th data-field="NID">NurseID</th>
                            <th data-field="name">Name</th>
                            <th data-field="gender">Gender</th>
                            <th data-field="location">Location</th>
                            <th data-field="phone">Phone</th>
                            <th data-field="Email">Email</th>
                            <th data-field="date">Join Date</th>
                        </tr>
                    </thead>
                    <tbody>
                    {
                        this.showList()
                    }
                    </tbody>
                </Table>
            </div>
        )
    }
}

export default NurseList;
